import './userReg.css';
import React, { useState } from 'react';
import axios from 'axios';

const UserReg = () => {
    const [message, setMessage] = useState('');
    const [name, setname] = useState("");
    const [email, setemail] = useState("")
    const [password, setpassword] = useState("")
    const [phone_number, setphone_number] = useState("");
    const [IntrestedAreas, setIntrestedAreas] = useState("")
    const [confirmPassword, setconfirmPassword] = useState("")
    cons
    const handleSubmit = async (e) => {
        e.preventDefault();
        // Form data for the POST request
        const data = new FormData();


        try {
            console.log(data);
            const response = await axios.post('http://localhost:5000/userReg', data);
            console.log(response.data); // Handle the response
            setMessage("Registration successful");
            setTimeout(() => {
                setMessage('');

            }, 2000);
        } catch (error) {
            console.error('There was an error uploading the data!', error);
        }
    };

    return (
        <>
            {message && <p>{message}</p>}
            <div className="body">
                <div className="wrapper">
                    <h1 className="title">User Registration</h1>
                    <form onSubmit={handleSubmit}>
                        <div className="info">
                            <div className="input-box">
                                <label>Full Name</label>
                                <input
                                    type="text"
                                    name="name"
                                    placeholder="Enter Full Name"
                                    value={name} onChange={(e) => setname(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="input-box">
                                <label>Email Address</label>
                                <input
                                    type="email"
                                    name="email"
                                    placeholder="Enter Email Address"
                                    value={email} onChange={(e) => setemail(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="input-box">
                                <label>Phone Number</label>
                                <input
                                    type="text"
                                    name="phone_number"
                                    placeholder="Enter Phone Number"
                                    value={phone_number} onChange={(e) => setname(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="input-box">
                                <label>Gender</label>
                                <select
                                    name="gender"
                                    value={gender} onChange={(e) => setname(e.target.value)}
                                    required
                                >
                                    <option value="">Select Gender</option>
                                    <option value="Female">Female</option>
                                    <option value="Male">Male</option>
                                    <option value="Others">Others</option>
                                </select>
                            </div>
                            <div className="input-box">
                                <label>Password</label>
                                <input
                                    type="password"
                                    name="password"
                                    placeholder="Enter Password"
                                    value={name} onChange={(e) => setname(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="input-box">
                                <label>Confirm Password</label>
                                <input
                                    type="password"
                                    name="confirmPassword"
                                    placeholder="Confirm Password"
                                    value={name} onChange={(e) => setname(e.target.value)}
                                    required
                                />
                            </div>
                            <div className="input-box">
                                <label>Interested Areas</label>
                                <textarea
                                    name="InterestedAreas"
                                    rows="4"
                                    cols="50"
                                    placeholder="Enter interested areas"
                                    value={name} onChange={(e) => setname(e.target.value)}
                                    required
                                />
                            </div>
                        </div>
                        <div className="btn">
                            <input type="submit" value="Register" />
                        </div>
                    </form>
                </div>
            </div>
        </>
    );
}

export default UserReg;
